import './App.css';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom'
import About from './Components/about/About';
import Main from './Components/main/Main';
import Nav from './Components/navbar/Nav';

function App() {
	return (

		<>
			<Router>
				<Routes>
					<Nav />
					<Main />
					<About />
				</Routes>
			</Router>
		</>
	);
}

export default App;
